import styled from 'styled-components';

const Content = styled.div`
  padding: 20px 25px;
`;
const P = styled.p`
  font-size: 24px;
  color: red;
`;

function App() {
  return (
    <Content>
      <P>Hello</P>
    </Content>
  );
}

export default App;
